import React from "react";
import { useQuery, gql } from "@apollo/client";

const getShipments = gql`
  query {
    user(id: 2) {
      name
    }
  }
`;

const MyShipments = () => {
  const { error, data, loading } = useQuery(getShipments);
  console.log({ error, data, loading });
  if (loading) {
    return <p>Loading...</p>;
  }
  return <div>{data && data.users.map((user, key) => <p key={key}>{user.id}</p>)}</div>;
};

export default MyShipments;
